import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";


function Certificateslider() {
    
    return (
      <Carousel
        swipeable={false}
        draggable={false}
        showDots={true}
        responsive={responsive}
        ssr={true} // means to render carousel on server-side.
        infinite={true}
        autoPlaySpeed={1000}
        keyBoardControl={true}
        customTransition="all .5"
        transitionDuration={500}
        containerClass="carousel-container"
        removeArrowOnDeviceType={["tablet", "mobile"]}
        dotListClass="custom-dot-list-style"
        itemClass="carousel-item-padding-40-px"
      >
        <div>
          <img src="https://letsenhance.io/static/8f5e523ee6b2479e26ecc91b9c25261e/1015f/MainAfter.jpg" />
        </div>
        <div>
          <img src="https://img.freepik.com/free-photo/colorful-design-with-spiral-design_188544-9588.jpg" />
        </div>
        <div>
          <img src="https://fps.cdnpk.net/images/home/subhome-ai.webp?w=649&h=649" />
        </div>
        <div>
          <img src="https://th.bing.com/th/id/OIG2.9O4YqGf98tiYzjKDvg7L" />
        </div>
        <div>
          <img src="https://www.bkacontent.com/wp-content/uploads/2016/06/Depositphotos_31146757_l-2015.jpg" />
        </div>
        <div>
          <img src="https://i0.wp.com/picjumbo.com/wp-content/uploads/amazing-stone-path-in-forest-free-image.jpg?w=600&quality=80" />
        </div>
        <div>
          <img src="https://letsenhance.io/static/8f5e523ee6b2479e26ecc91b9c25261e/1015f/MainAfter.jpg" />
        </div>
      </Carousel>
    );
}
export default Certificateslider;
